import React, { useState } from 'react';
import styles from './styles.css';

const CardsDetail = () => {
    const [imageClicked, setImageClicked] = useState(false);

    const handleImageClick = () => {
        setImageClicked(!imageClicked);
    };

    return (
        <div className='cards-detail-container'>
            <div className='card-detail'>
                <div className="div-img-container" onClick={handleImageClick}>
                    <img className={`card-img card-img-1 ${imageClicked ? 'expanded' : ''}`} src={require('../../assets/CardsImg/_DSC0030.jpg')} alt="Card 1" />
                </div>
                <div className="card-content">
                    <h3>Titulo</h3>
                    <div className="card-paragraph">
                        <p>lorem fwfwqefwfqfqqwffwffff</p>
                    </div>
                </div>
            </div>
            {/* ... Las otras tarjetas siguen aquí */}
        </div>
    )
}

export default CardsDetail;

















